import React from 'react'
import Search from "./Search";
import Menu from "./Menu";
import './index.css'

const Header = (props) => (
    <header className={'header'}>
        <Search heading={props.heading}/>
        <Menu buttons={props.buttons} onChangeHeading={props.onChangeHeading}/>
    </header>
);

export default Header
